import {
  Add as AddIcon,
  EmailOutlined as Email,
  Person as PersonIcon,
  Phone,
} from '@mui/icons-material';
import ListItemAvatar from '@mui/material/ListItemAvatar';
import {
  Avatar,
  Box,
  Breadcrumbs,
  Chip,
  Divider,
  Link,
  List,
  ListItem,
  ListItemButton,
  ListItemText,
  ListSubheader,
  Typography
} from '@mui/material';
import { blueGrey, blue } from '@mui/material/colors';
import { useEffect, useState } from 'react';
import { useFetch } from '../../hooks';
import { API, getURI } from '../../services';
import * as Styled from './StatusList.styled';

interface IPilot {
  id?: number;
  userId: number;
  firstName: string;
  lastName: string;
  cpf: string;
  cellphone: string;
  email: string;
  status: string;
}

export const StatusList = () => {
  const [pilots, setPilots] = useState<Array<IPilot>>();
  const { data } = useFetch<Array<IPilot>>({ url: getURI(API.status) });

  useEffect(() => {
    if (data && data.length) {
      setPilots(data);
    }
  }, [data]);

  return (
    <>
      <Box>
        <Box sx={{ padding: '15px' }}>
          <Breadcrumbs aria-label="breadcrumb">
            <Link underline="hover" color="inherit" href="/">
              Dashboard
            </Link>
            <Typography color="text.primary">Pilotos</Typography>
          </Breadcrumbs>
        </Box>
        {pilots && (
          <List
            subheader={
              <ListSubheader
                component="div"
                id="nested-list-subheader"
                color="primary"
              >
                Total de {pilots.length} pilotos aptos para decolagem. - Bom Vôo!
              </ListSubheader>
            }
          >
            {pilots.map((pilot, userId) => (
              <Box key={userId}>
                <ListItem disablePadding>
                  <ListItemButton>
                    {' '}
                    <ListItemAvatar sx={{ fontSize: 30, color: blue[500], mr: 2 }}>
                      <Avatar alt={pilot.firstName} src="/static/images/avatar/3.jpg" />
                    </ListItemAvatar>
                    <ListItemText>
                      <Typography variant="h5" component="h3">
                        {pilot.firstName} {pilot.lastName}
                        <Chip
                          label={pilot.status}
                          color="primary"
                          size="small"
                          sx={{ ml: 6 }}
                        />
                      </Typography>
                    </ListItemText>
                    <ListItemText                      
                      secondary={
                        <span style={{ display: 'flex', alignItems: 'center' }}>
                          <Phone sx={{ fontSize: '14px' }} />
                          <Typography
                            sx={{ paddingLeft: '5px', paddingTop: '2px' }}
                            variant="caption"
                            color={blueGrey[500]}
                          >
                            {pilot.cellphone}
                          </Typography>

                        </span>
                      }
                      key={pilot.userId}
                      sx={{ width: '210px' }}
                    />
                  </ListItemButton>
                </ListItem>
                <Divider />
              </Box>
            ))}
          </List>
        )}
      </Box>
      <Styled.AddButton color="primary" aria-label="add">
        <AddIcon />
      </Styled.AddButton>
    </>
  );
};
